import { IonButton, IonModal } from "@ionic/react";
import { Button, Card, Col, Form, Modal, Row } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import FormLogin from "./FormLogin";


const ModalConfirm = () => {

  const {feha_nac='',number_phone='',puesto=''} = useSelector((state: any) => state.userInfo);
    const { statusModal = false } = useSelector((state: any) => state.effects);
    const dispatch = useDispatch();

    return <Modal
        show={statusModal}
        swipeToClose={false}
        backdropDismiss={false}
        backdrop="static"
        onHide={() => dispatch({ type: 'OFF_MODAL' })}        
    >
        <Modal.Header>
            <Card.Title > Confirmar datos:</Card.Title>
        </Modal.Header>
        <Card.Body>
            <Form>
            <Row>
                <Col sm={6}>
                    <FormLogin                    
                        title='Fecha nacimiento'
                        required
                        type='date'
                        value={feha_nac}
                    />
                </Col>
                <Col sm={6}>
                    <FormLogin                      
                        title='Telefono'
                        required
                            type='tel'
                            value={number_phone}
                    />
                </Col>
                <Col sm={12}>
                    <FormLogin                      
                        title='Pesto'
                            required
                            type='text'
                            disabled
                            value={puesto}
                    />
                </Col>
                <Col xs={6}>
                    <IonButton
                        onClick={() => dispatch({ type: 'OFF_MODAL' })}
                        expand='block'
                        color='light'
                        fill='solid' type='reset' >CANCELAR</IonButton>
                </Col>
                <Col xs={6}>
                    <IonButton expand='block' color='success' fill='solid' type='submit' >GUARDAR</IonButton>
                </Col>
            </Row>
            </Form>
        </Card.Body>
    </Modal>;
}

export default ModalConfirm;
